"This tattoo got me into a lot of trouble because I had a contract and I wasn't supposed to get tattoos and I did; but it was worth it because I love this tattoo and the meaning behind it". Watch as British supermodel Jourdan Dunn shares the story behind her three favorite tattoos and reveals what makes them so special.

"Ce tatouage m'a causé bien des soucis car j’avais alors un contrat qui stipulait que je n’étais pas censée me faire tatouer : et je l’ai tout de même fait. Mais ça valait le coup, je l’adore et j’aime encore plus sa signification ». En exclusivité pour Vogue, le top britannique Jourdan Dunn livre les secrets de ses trois tatouages favoris et raconte ce qui les rend si particuliers.

